import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Form } from 'react-bootstrap';
import {
  BrowserRouter as Router,
  Route, Link
} from "react-router-dom";
import Createuser from './Createuser';
class Login extends Component {
  handleRequert(){
    var {username,password }=this.refs;
   axios.post('/login1',{username:username.value,password:password.value})
    .then(res=>{
       if (res.data="that bai") {this.setState({a:"ac"})} else  this.setState({a:""}) ;
     console.log(res.data);
     console.log(this.state.a);
   })
    .catch(err => console.log(err))
  }
  render(){
  return (
    <div>
      <Form id="form-login" action="/" >
        <p>
          <label for="username">username: </label>
          <input type="text" id="username" name="username" autocomplete="off"></input>
        </p>
        <p>
          <label for="pasword">Password: </label>
          <input type="password" id="password" name="password" autocomplete="off"></input>
        </p>
        <input type="submit" value="Submit"></input>
      </Form>
    </div>
  );
}}

export default Login;
